 ('461041512','813286','BarackObama','In Iowa at two presidential forums today: The Heartland Forum at 3:30pm ET on C-SPAN & The Brown & Black Forum at 8pm ET on HDNet.','2007-12-01 21:45:58'),
 ('448528472','813286','BarackObama','In Portsmouth, NH holding a foreign policy forum.  Watch it live stream at http://my.barackobama.com/page/content/fpforum','2007-11-27 18:04:07'),
 ('417913262','813286','BarackObama','In Las Vegas, NV for the presidential debate. It will be broadcast live tonight at 8pm ET on CNN.  Txt your thoughts throughout to 62262.','2007-11-16 01:00:26'),
 ('415162962','813286','BarackObama','At Google\'s Town Hall in Mountain View,CA  Speaking about the need for network neutrality!','2007-11-15 00:42:43'),
 ('396941082','813286','BarackObama','In Iowa this week.  Just announced plan today to \"Reclaim the American Dream\"  Learn more about the plan at http://my.barackobama.com/dream','2007-11-08 04:50:36'),
 ('372864392','813286','BarackObama','In Cedar Rapids, IA at Coe College for the MySpace MTV Presidential Dialogue. It will stream live at 1:30pm ET www.myspace.com/election2008','2007-10-29 17:02:49'),
 ('358041612','813286','BarackObama','In Boston with Governor Deval Patrick for a rally starting at 5:30PM at Parkman Bandstand on Boston Common  http://my.barackobama.com/bos','2007-10-23 22:17:00'),
 ('346029382','813286','BarackObama','In Nevada today and excited to be on the Tavis Smiley Show tonight on PBS. Check your listings for what time it airs locally.','2007-10-19 00:03:32'),
 ('343509982','813286','BarackObama','In Los Angeles, CA.  Going to be on NBC\'s Tonight Show with Jay Leno tonight. Check local listings for exact time.','2007-10-18 01:04:27'),
 ('321156922','813286','BarackObama','In Portsmouth, NH -just announced a visionary plan to make America a global leader on energy. For details visit www.barackobama.com/speeches','2007-10-09 00:08:41'),
 ('307408422','813286','BarackObama','In Chicago, at DePaul University speaking about the need to eliminate the world\'s nuclear weapons. Watch live now http://www.cnn.com/video','2007-10-02 18:47:15'),
 ('297529302','813286','BarackObama','At rally in Washington Square Park, NYC  - Watch full event live now at http://www.barackobama.com/nyc','2007-09-28 01:01:22'),
 ('295555602','813286','BarackObama','At Dartmouth College at the DNC debate.  It airs live from 9-11pm ET on MSNBC  text your thoughts on the debate to 62262.','2007-09-27 03:42:15'),
 ('282953412','813286','BarackObama','In Atlanta: had a great event with Usher and Dominique Wilkins. Fired Up!','2007-09-21 05:34:47'),
 ('276831892','813286','BarackObama','In Washington DC, talking about reforming America’s tax code so that it works for the middle class. Visit www.barackobama.com for details.','2007-09-18 17:34:52'),
 ('262432362','813286','BarackObama','Giving a major Iraq policy speech tomorrow in Iowa and will also be live on the Today Show tomorrow morning at 7:00am.','2007-09-12 03:52:40'),
 ('249809452','813286','BarackObama','Speaking at town halls in Sac City and Storm Lake, Iowa today. Heading to Nevada tomorrow.','2007-09-06 00:52:06'),
 ('235503102','813286','BarackObama','Thinking on this 2nd anniversary of Katrina that New Orleans should become an example of what America can do when we come together.','2007-08-29 23:43:11'),
 ('220886672','813286','BarackObama','In New York - heading to The Daily Show with Jon Stewart.  Be sure to watch it on Comedy Central tonight.','2007-08-22 22:45:01'),
 ('211537812','813286','BarackObama','In Tama, IA for a Rural Policy Summit @ South Tama County High School.  Heading to Cedar Rapids and Waverly tomorrow.','2007-08-17 23:03:56'),
 ('209493312','813286','BarackObama','In Iowa this week and heading to the Iowa State Fair later this afternoon- Visit http://iowa.barackobama.com/roadtochange for full schedule.','2007-08-16 19:53:43'),
 ('192555492','813286','BarackObama','In Chicago - heading to the AFL-CIO Presidential Forum.  It is on MSNBC tonight live at 7pm EDT, moderated by Keith Olbermann.','2007-08-07 23:30:54'),
 ('170096102','813286','BarackObama','Addressing the College Democrats of America at their national convention in Columbia, SC.','2007-07-26 22:43:39'),
 ('158199002','813286','BarackObama','Enjoying an ice cream social with residents of Sunapee, New Hampshire.','2007-07-20 00:00:13'),
 ('152903462','813286','BarackObama','In Chicago, walking picket line with hotel workers at the Congress Hotel. For more info visit http://www.congresshotelstrike.info','2007-07-16 22:53:04'),
 ('141791322','813286','BarackObama','Heading to Alabama for the Birmingham kick-off rally.','2007-07-09 21:57:25'),
 ('125365592','813286','BarackObama','In DC heading to Howard University for the presidential debate @ 9pm EDT on PBS stations. Txt your thoughts on the debate to OBAMA (62262)','2007-06-29 02:49:22'),
 ('121928412','813286','BarackObama','In DC: Asking you to share what inspires you on the front page of www.barackobama.com','2007-06-26 23:46:47'),
 ('112224892','813286','BarackObama','Launching Obama Mobile text messaging; text \'GO\' to OBAMA (62262) to get a free bumper sticker.','2007-06-20 04:53:08'),
 ('106484782','813286','BarackObama','Traveling to Jackson, Mississippi - excited after rallying with over 3500 supporters in Greenville, South Carolina.','2007-06-16 03:56:49'),
 ('103634902','813286','BarackObama','Being featured on YouTube \"Candidate Spotlight\" asking how can we make this country better?','2007-06-14 04:44:34'),
 ('96637982','813286','BarackObama','Preparing for our big \"Walk for Change\" national canvass - Heading to Dubuque, Iowa for tomorrow\'s walk.','2007-06-09 02:58:23'),
 ('89585682','813286','BarackObama','Heading to Democratic presidential debate at St. Anselm College in New Hampshire.  Debate starts at 7pm EST and will air live on CNN.','2007-06-03 22:49:52'),
 ('85862772','813286','BarackObama','Looking forward to watching Michelle\'s interview on NBC nightly news tonight.','2007-05-31 23:46:37'),
 ('82737212','813286','BarackObama','At the University of Iowa envisioning affordable universal healthcare by end of first term.','2007-05-29 18:32:16'),
 ('77263482','813286','BarackObama','In DC voting No...  \"We should not give the President a blank check to continue down this same, disastrous path.”','2007-05-25 04:05:27'),
 ('70349392','813286','BarackObama','Speaking at Southern New Hampshire University Commencement','2007-05-19 20:57:28'),
 ('66208452','813286','BarackObama','Thinking the President’s word is not the last word on Iraq.','2007-05-16 22:47:37'),
 ('63909652','813286','BarackObama','In Trenton, NJ at AFL-CIO Town Hall Meeting','2007-05-14 20:25:24'),
 ('59358952','813286','BarackObama','In Indianola, Iowa and heading to Des Moines','2007-05-11 04:15:18'),
 ('55928192','813286','BarackObama','Thinking we can cut oil consumption by 2.5 million barrels of oil per day and take 50 million cars’ worth of pollution off the road by 2020','2007-05-09 00:01:32'),
 ('53427172','813286','BarackObama','At the Detroit Economic Club – Talking about the need to reduce our dependence on foreign oil.','2007-05-07 18:52:28'),
 ('46195712','813286','BarackObama','Wondering why, four years after President Bush landed on an aircraft carrier and declared ‘Mission Accomplished,’ we are still at war?','2007-05-01 21:12:21'),
 ('44240662','813286','BarackObama','Thinking we\'re only one signature away from ending the war in Iraq. \nLearn more at http://www.barackobama.com','2007-04-29 22:04:13');
